import React from 'react';

function Profile({ user }) {
  return (
    <div className='pro'>
      <h1>{user.login}</h1>
      <img src={user.avatar_url} alt="User Avatar" />
      <p>{user.bio}</p>
      <p>Number of repositories: {user.public_repos}</p>
      <a href={`/repos/${user.login}`}>View Repositories</a>
    </div>
  );
}

export default Profile;
